description:
The game Crazy Drive is comprised of a wild mix of race tracks and arcade style action. The players need to navigate their way to the city, but not everyone possesses the strength and skill to do just that. 

On the road, you will come across tractors, trucks, bumps, huge puddles of oil, and multiple road hazards with maintenance crews standing by. However steering the vehicle only requires a bit of your concentration! 

